package test02;

public class switchstr {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String str="three";
		switch(str){
		case "one":
	        System.out.println("one");
	        break;
	      case "two": 
	        System.out.println("two");
	        break;
	      case "three":
	        System.out.println("three");
	        break;
	      default: 
	        System.out.println("no match");
	        break;
		}
	}

}
